// NOTE: actually, FST nodes are seldom 
// identical when outputs on their arcs 
// aren't NO_OUTPUTs.
@Override
public int hashCode() {
  int hash = 0;
  if (longs != null) {
    final int end = longs.length;
    for (int i = 0; i < end; i++) {
      hash -= longs[i];
    }
  }
  if (bytes != null) {
    hash = -hash;
    final int end = bytes.length;
    for (int i = 0; i < end; i++) {
      hash += bytes[i];
    }
  }
  hash += docFreq + totalTermFreq;
  return hash;
}

